import './Guide.css';
import ButtonImage from "../button_img/ButtonImage.js";

export default function Guide() {
  return (
    <div className="App">
      <header className="App-title">ANIL Inventory Management Tool User Guide</header>
      <div className="App-header">
        <ButtonImage img_path="./menu_img/borrow.png" site="/" name="Borrow Rules" />
        <ButtonImage img_path="./menu_img/return.png" site="/" name="Return Rules" />
        <ButtonImage img_path="./menu_img/tutorial.png" site="/" name="Update Turorial" />
        <ButtonImage img_path="./menu_img/start.png" site="/" name="Start" />
      </div>
    </div>
  );

}
